import RanksEdit from "./edit/RanksEdit.js";
import RanksDefault from "./default/RanksDefault.js";
export default {
  props: {
    ranks: {
      type: Array,
      required: true
    },
    maxRanks: {
      type: Number,
      required: true
    },
    route: {
      type: String,
      required: true
    },
    editableRank: {
      type: Object,
      required: true
    }
  },
  render(h) {
    if (this.route === 'ranks/edit') {
      return h(RanksEdit, {
        key: 'ranks/edit',
        props: {
          editableRank: this.editableRank
        }
      });
    } else {
      return h(RanksDefault, {
        key: 'ranks',
        props: {
          ranks: this.ranks,
          maxRanks: this.maxRanks
        }
      });
    }
  }
};

